import "./App.css";
import { Userprop } from "./User";

function App() {
  const Users = [
    { name: "pedro", age: 25 },
    { name: "Umair", age: 20 },
    { name: "James", age: 28 },
    { name: "John", age: 27 },
  ];


  return (
    <div className="App">
      {Users.map((User, key) => {
        return <Userprop name={User.name} age={User.age} />;
      })}
    </div>
  );
}



export default App;
